import React, { useRef, useState, Suspense } from 'react'
import { Canvas, useFrame } from '@react-three/fiber'
import { softShadows, OrbitControls, useGLTF, PerspectiveCamera  } from '@react-three/drei'
//import Header from "./components/header"
import { proxy, useProxy } from 'valtio'
import './App.css'

const state = proxy({sand:"#000000",})

softShadows();


function Sand(props) {
  const group = useRef()
  const { nodes, materials } = useGLTF('Canvas_Sand.glb')
  return (
    <group ref={group} {...props} dispose={null}>
      <group position={[-496.54, 0, -6000]} rotation={[-Math.PI, 0, -Math.PI]}>
        <mesh geometry={nodes.Landscape3_1.geometry} material={nodes.Landscape3_1.material} />
      </group>
      <mesh geometry={nodes.Landscape1.geometry} material={nodes.Landscape1.material} position={[318.05, 0, 0]} />
    </group>
  )
}

function App() { 
  return (
    <Canvas colorManagement >

      <PerspectiveCamera makeDefault position={[700,800,-8000]} far={800000} fov={60} rotation={[Math.PI, Math.PI, 0]} />
      <gridHelper />
      <fog attach="fog" args={["black", 0, 100000]} />
      <ambientLight intensity={0.3} />
      <directionalLight castShadow intensity={0.3} color="white" position={[0, 0, 5]} />
      <Suspense fallback={null}>
        <Sand />
      </Suspense>
      <OrbitControls />
    </Canvas>
  )
}

export default App
